import Link from 'next/link';
import React from 'react';

const UserLink = ({
	className,
	disabled,
}: {
	className?: string;
	disabled?: boolean;
}) => {
	if (disabled) {
		return (
			<a
				className={
					'text-yellow-400 font-medium' + (className ? ` ${className}` : '')
				}
			>
				RiznSun
			</a>
		);
	}

	return (
		<Link href="/users/1">
			<a
				className={
					'text-yellow-400 font-medium' + (className ? ` ${className}` : '')
				}
			>
				RiznSun
			</a>
		</Link>
	);
};

export default UserLink;
